import React from 'react'
import NavBar from '../functional/NavBar'
import { BrowserRouter } from 'react-router-dom'

const LandingPage = () => {
    return (
        <BrowserRouter>
            <div className="container">
                <NavBar />
                <h1 className="center">
                    ItineraryApp
            </h1>
            </div>
        </BrowserRouter >
    )
}

export default LandingPage;
